import React from "react";
import { QuestionModal } from "./QuestionModal";
import { Sidebar } from "./Sidebar";

const Dashboard = () => {
  return (
    <Sidebar>
      <h1>Dashboard</h1>
      <QuestionModal />
      <SubjectModal />>
    </Sidebar>
  );
};

export default Dashboard;
